// Libraries
import React from 'react'
import { Link } from 'react-router'

// Components
import SessionStore from 'stores/session'
import IconButton from 'shared/iconButton'

export default () => {
  let user = SessionStore.getUser()
  return (
    <div className='columns'>
      <div className='column'>
        <h1 className='subheader-green'>Información General</h1>
        <div className='flex-between'>
          <div className='title' style={{ marginBottom: '16px' }}>
            {user.name}
          </div>
          <Link to='/mi-cuenta/editar'>
            <IconButton icon='pencil' tooltip='Editar' />
          </Link>
        </div>
        <div className='caption'>Correo electrónico</div>
        <div className='body' style={{ marginBottom: '12px' }}>
          {user.email}
        </div>
      </div>
    </div>
  )
}
